import React, {Component, Fragment} from 'react';

class ListByCategory extends Component {
    render() {
        return (
            <Fragment>
                <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
                <h1>{this.props.Category}</h1>


            </Fragment>
        );
    }
}

export default ListByCategory;
